import React from "react";
import {
  icon_brand_recognition,
  icon_detailed_records,
  icon_fully_customizable,
} from "../../assets/images";

const DATA_SET = [
  {
    iconName: icon_brand_recognition,
    title: "Brand Recognition",
    title:
      "Bost your brand recogition with each click. Generic links dont mean a thing. Branded links help install confidence in your content",
  },
  {
    iconName: icon_detailed_records,
    title: "Detailed Records",
    title:
      "Gain insights into who is clicking your links. Knowing when and where people engage with your content helps inform better decisions",
  },
  {
    iconName: icon_fully_customizable,
    title: "Fully Customizable",
    title:
      "IMprove brand awarness and content discoverability through customizable links, supercharging audience engagment",
  },
];

function Card() {
  return (
    <div
      style={{
        width: "20%",
      }}
    >
      {DATA_SET.map((data) => (
        <div>
          <div
            style={{
              width: 125,
              height: 125,
              backgroundColor: "red",
              margin: 9,
            }}
          >
            <img
              src={data.iconName}
              style={{
                width: "100%",
                height: "100%",
              }}
            />
          </div>
        </div>
      ))}
    </div>
  );
}

export default Card;
